            } else if (event.key === 'a'){
                monkey_mesh.position.x -= 1;
            } else if (event.key === 'd'){
                monkey_mesh.position.x += 1;
            } else if (event.key === 'w'){
                monkey_mesh.position.y += 1;
            } else if (event.key === 's'){
                monkey_mesh.position.y -= 1;
            } else if (event.key === 'ArrowUp'){
                monkey_mesh.rotation.x += 0.5; 
            } else if (event.key === 'ArrowDown'){
                monkey_mesh.rotation.x -= 0.5; 
            } else if (event.key === 'ArrowLeft'){
                monkey_mesh.rotation.z += 0.5; 
            } else if (event.key === 'ArrowRight'){
                monkey_mesh.rotation.z -= 0.5; 
            } 
        });

    </script>
</body>
